{{Infobox dungeon |name = Plasma Frigate |image = [[File:Plasma Frigate.png|300px]] |caption = A map of Plasma Frigate. |tokens = 257,500 |location = East of Seaside Cave }} '''Plasma Frigate''' is a [[Dungeons|dungeon]] in [[Unova]]. It has 81 tiles arranged in an 9x9 square, including 9 chest tiles, 21 non-boss encounter tiles, and 1 boss encounter tile.
